import Student from './component/student';
//import React, { Component } from 'react';
import './App.css';
import Shop from './component/shop';


import React from 'react';

const Goals = true;

const MissedGoal = () => {
  return <h1>Missed!</h1>;
}

const ScoredGoal = () => {
  return <h1>Scored!</h1>;
}

const Car = (props) => {
  return <li>{props.brand}</li>;
}

const Garage = () => {
  const Cars = ['Ford', 'Benz', 'BMW'];

  return (
    <>
      <h1>Vehicle</h1>
      <ul>
        {Cars.map((car, index) => (
          <Car key={index} brand={car} />
        ))}
      </ul>
    </>
  );
}

function App() {
  if (Goals) {
    return (
      <>
        <ScoredGoal />
        <Garage />
      </>
    );
  } else {
    return (
      <>
        <MissedGoal />
        <Garage />
      </>
    );
  }
}

export default App;
